import React from 'react';
import { Bar } from 'react-chartjs-2';

const TaskAnalyticsChart = () => {
  const data = {
    labels: ['In Progress', 'Needs Review', 'Needs Attention'],
    datasets: [
      {
        label: 'Number of Tasks',
        data: [12, 5, 3],
        backgroundColor: [
          'rgba(75, 192, 192, 0.2)',
          'rgba(153, 102, 255, 0.2)',
          'rgba(255, 159, 64, 0.2)',
        ],
        borderColor: [
          'rgba(75, 192, 192, 1)',
          'rgba(153, 102, 255, 1)',
          'rgba(255, 159, 64, 1)',
        ],
        borderWidth: 1,
      },
    ],
  };

  const options = {
    scales: {
      y: {
        beginAtZero: true,
      },
    },
  };

  return <Bar data={data} options={options} />;
};

export default TaskAnalyticsChart;
